Электрокардиографы типа Cardipia 800 с 6/12 каналами представляют собой компактный переносной аппарат для оперативного снятия кардиограммы с одновременной регистрацией шести или двенадцати синхронно записанных отведений. Работа электрокардиографа основана на методе наложения электродов с использованием принципа съема потенциалов с поверхности человеческого тела.
Электрокардиограф типа Cardipia 800 - универсальный, надежный, модернизированный прибор последнего поколения. С его помощью можно проводить электрокардиографические обследования, соответствующие типовым методикам функционального диагностирования.
Многоканальный аппарат Cardipia 800 широко используется:
- в кардиологических отделениях, в функциональной диагностике и интенсивной терапии стационарных больных;
- для проведения оперативной диагностики в автомобиле скорой помощи;
- на этапе проведения поликлинических обследований, а также в медико-санитарных частях;
- в частных медицинских кабинетах.

Электрокардиографы серии Cardipia 400 – это приборы, позволяющие проводить сравнительный анализ сердечных биопотенциалов.
Отображение электрокардиограммы происходит на дисплее аппарата, после чего она записывается на бумаге и сохраняется в памяти. Электрокардиограф нового поколения Cardipia  400 автоматически интерпретирует ЭКГ и устанавливает предварительный диагноз.
Кроме того, данная модель электрокардиографа оснащена специальными фильтрами, нивелирующими сетевые наводки и подавляющими артефакты активности мышц, что позволяет получить точный результат кардиограммы.
С помощью портативного цифрового многоканального электрокардиографа Cardipia 400 возможно:
- Получить достоверные данные о физическом состоянии сердечной мышцы;
- Выявить периодичность и регулярность сердечных сокращений;
- Выявить аритмию (отсутствие отдельных сокращений);
- Выявить хроническое или острое повреждение миокарда (ишемию или инфаркт);
- Провести диагностику внутрисердечной проводимости;
- Определить острую сердечную патологию без хирургического вмешательства.
